import React, {Component} from 'react';
import Cardlist from './Cardlist';
import {robots} from './robots';
import SearchBox from './SearchBox';

class App extends Component {
	constructor() {
        super()
        this.state= {
        	robots: robots,
        	searchField: '',
        }
	}
	render(){
		return (
			<div className='tc'>
			<h1>roboFriends</h1>
			<SearchBox />
			<Cardlist robots={robots}/>
			</div>
			);
    }
}

export default App;
